If you only care about retrieving relation information from one side of the relation, you don't need a @relation directive: type Foot { id: ID! shoe: Shoe
} type Shoe { id: ID!
} In the above example, you will be able to select the shoe of a foot, like so: query { readFoot(search: { id: { eq: "7c3nrr-6jhf3-2gozt-hh37a-d6nvf-lsdwv-d7bhp-uk5nt-r42y" } }) { id shoe { id } }
} You will not be able to select the foot of a shoe.

