If you care about retrieving relation information from both sides of the relation, add a @relation directive. The name argument of the @relation directive can be arbitrary, but it must be the same on both sides of the relation. type Foot { id: ID! shoe: Shoe @relation(name: "Foot:shoe and Shoe:foot")
} type Shoe { id: ID! foot: Foot @relation(name: "Foot:shoe and Shoe:foot")
}

